class Solution:
    def __init__(self) -> None:
        self.swimmers = []

    def read_input(self, input_str: str) -> None:
        lines = input_str.split('\n')
        n = int(lines[0])
        for i in range(1, n+1):
            x, y = map(int, lines[i].split())
            self.swimmers.append((x, y))

    def divide_swimmers(self) -> Tuple[int, int]:
        def distance(a, b):
            return abs(a[0] - b[0]) + abs(a[1] - b[1])

        swimmers = self.swimmers
        swimmers.sort(key=lambda x: distance(x, (0, 0)))
        swimmers_a = swimmers[:len(swimmers)//2]
        swimmers_b = swimmers[len(swimmers)//2:]

        for i in range(len(swimmers_a)):
            for j in range(len(swimmers_b)):
                if distance(swimmers_a[i], swimmers_b[j]) <= 1:
                    x, y = swimmers_a[i]
                    return x, y

        x, y = swimmers_a[0]
        return x, y

    def output_solution(self) -> str:
        x, y = self.divide_swimmers()
        return f"{x} {y}\n{-x} {-y}"

