    def __init__(self, m):
        self.m = m
        self.weighings = []

    def weigh(self, coins):
        if len(self.weighings) >= self.m:
            return "Insufficient weighings"
        self.weighings.append(coins)
        total_weight = sum(coin.weight for coin in coins)
        return total_weight

