class Solution:
    def solution(self, n: int, a: List[int]) -> str:
        def check_piles(piles: List[int]) -> bool:
            for i in range(len(piles)):
                for j in range(i+1, len(piles)):
                    if piles[i] == piles[j]:
                        return False
            return True

        piles = a[:]
        for _ in range(2*n):
            if not check_piles(piles):
                return "sjfnb"
            for i in range(len(piles)):
                if piles[i] > 0:
                    piles[i] -= 1
                    break
            else:
                return "cslnb"
        return "sjfnb"

    def solve(self, stdin: str) -> str:
        n, *a = map(int, stdin.split())
        return self.solution(n, a)

